import React from "react";
import "./Rules.css";

function Gallery() {
  return (
    <div style={{ padding: "20px" }}>
      <h1>Galleri</h1>
      <p>Se bilder från våra sjöar och evenemang.</p>

      <div className="rules-container" style={{ padding: "20px" }}>
        {/* Instagram post */}
        <iframe
          src="https://www.instagram.com/kilsbergensportfiske/"
          width="400"
          height="480"
          frameBorder="0"
          scrolling="no"
          allowTransparency="true"
          title="Instagram Post"
          style={{ borderRadius: "8px" }}
        ></iframe>

        {/* Du kan lägga till fler poster genom att kopiera iframen med andra POST_ID */}
      </div>
    </div>
  );
}

export default Gallery;
